import './App.css';
import React from 'react';

function App() {
  const fetchData = async () => {
    try {
        const response = await fetch(
            `http://localhost:3000/api/exchange?authkey=3wNf5tfXGjytedr8fF3AUEljbd30YBED&searchdate=20180102&data=AP01`
        );
        const data = await response.json();
        console.log(data);
    } catch (error) {
        console.error(error);
    }
  };

  return (
    <button onClick={fetchData}>ddd</button>
  );
}

export default App;
